import UserList from "./components/UserList";
import { BrowserRouter, Router, Route } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <Router>
        <div className="container">
          <Route path="/" exact component={UserList} />
        </div>
      </Router>
    </BrowserRouter>
  );
}

export default App;
